                                 'TAIYUANFANGZHUO',
                                 'HAIKOULEKANG',
                                 'QINGDAOZHONGKANG',
                                 'LIAOCHENGZHONGKANG',
                                 'AIKANG'
          )
    and t1.status = 0) t
where top <= 100
order by t.TEMPLATE_TYPE, top;

